import React from "react";

function My() {
  var arr = ["Face book", "yahoo", "twitter"];
  var i = 0 ;
  return (
    <div>
      <li>
        <input type="checkbox"></input>
        <label>${arr[i++]}</label>
      </li>
    </div>
  );
}

export default My;
